        useEffect(()=>{
            dispatch(fetchshopcatproducts({"selectedCity":city,dealerid:DealerId}))
    
        })

const {shopdetail,shopproducts,shopfilter}=useSelector(state=>state.shoppage);
  
    console.log(shopdetail);
